<template>
    <div :style="{overflow:userInfo.nickName?'':'hidden',height:'100%'}"> 
        <div class="h" >
            <div class="userinfo" >
                <i-avatar class="touxiang"  :src="userInfo.avatarUrl" size="large" />
                <div class="userinfo-nickname">
                    <card :text="userInfo.nickName" v-if="userInfo.nickName||stroage"></card>
                </div>
            </div>
        </div>
        <div :style="{'padding-top':'30rpx','margin-top':'300rpx',overflow:'auto'}">
            <i-cell-group>
                <i-cell title="基本信息" is-link @click="baseMsg" url="/pages/me/baseMsg/main"></i-cell>
                <i-cell title="帮助反馈" is-link url="/pages/me/problem/main"></i-cell>
                <i-cell title="清除以往记录" @click="show=true"></i-cell>
                <i-cell title="关于" is-link @click="cons"></i-cell>
            </i-cell-group>
        </div>
        
        <!-- <Tip sure="确定" refuse="取消" content="是否使用账号登入" title="提示" :show="show" @close="close" @sh="jump"></Tip> -->
        <div class="ad" :style="{height:width/4*3+'px'}" v-if="showAd">
        </div>
        <i-toast id="toast" />
        <Tip sure="是" refuse="否" content="是否删除以往数据" title="提示" :sureCom="del" :show="show" @close="show=false"></Tip>
        <div v-if="!userInfo.nickName" style="text-align:center;position:absolute;top:0;bottom:0;right:0;left:0;background:rgba(0,0,0,0.3);z-index:1009">
            <button class="btn" size="mini" open-type="getUserInfo" @getuserinfo="onGetUserInfo" >微信一键登入</button>
        </div>
    </div>
</template>

<script>
import card from '@/components/card'
// import Btn from '../../components/button'
import Tip from '../../components/tip'
import { userInfo } from 'os';

export default {
    data(){
        return{
            userInfo:{
                nickName:'',
                avatarUrl:''
            },
            show:false,
            main:true,
            showAd:true,
            d:{},
            stroage:false,
            width:''
        }
    },
    methods:{
        closeAd(){
            this.showAd=false
        },
        cons(){
            console.log(this.$store.state.baseData.userId)
        },
        del(){
            this.$fetch.delAll({openId:this.$store.state.baseData.openId}).then(resp=>{
                this.show=false
                if(resp.data.returnCode){
                    this.$toast({
                        content:resp.data.returnMsg,
                        type:'success'
                    })
                }else{

                    this.$toast({
                        content:resp.data.returnMsg,
                        type:'error'
                    })
                }
            })
        },
        baseMsg(){
            this.main=false;
        },
        onGetUserInfo(e) {
            var that=this
            if(e.mp.detail.rawData){
                wx.login({
                    success:function(res){
                        var code=res.code;
                        console.log(code)
                        that.$fetch.login({url:code}).then(res=>{
                            res.data=JSON.parse(res.data.e)
                            that.$fetch.getUserInfo({openId:res.data.openid}).then(resp=>{
                                    that.$store.state.baseData=JSON.stringify(resp.data.area)=='null'?{...that.$store.state.baseData}:resp.data.area
                                    that.$store.state.baseData.openId=res.data.openid
                                    that.$store.state.login=true;
                                    that.userInfo.nickName=resp.data.area.userName||e.mp.detail.userInfo.nickName;
                                    that.$store.state.baseData.userName=that.userInfo.nickName
                                    that.d=JSON.parse(JSON.stringify(that.$store.state.baseData))
                                    that.d.avatarUrl=e.mp.detail.userInfo.avatarUrl
                                    wx.setStorage({key:'userInfo',data:JSON.stringify(that.d)})
                                    that.$fetch.getTang({openId:res.data.openid}).then(resp=>{
                                        that.$store.state.tangkou=resp.data.reverse()
                                    }).catch(e=>{
                                        that.$toast({
                                            content:'请检查网络',
                                            type:'warning'
                                        })
                                    })
                                }).catch(e=>{
                                    that.$toast({
                                        content:'请检查网络',
                                        type:'warning'
                                    })
                                })/*this.$store.state.baseData.userId*/
                        }).catch(e=>{
                            console.log(e)
                        })
                    }
                })
                
                this.userInfo.avatarUrl=e.mp.detail.userInfo.avatarUrl;
                
            }else{
                this.$toast({
                    content:'不授权无法获取服务',
                    type:'warning'
                })
            }
            // this.$fetch.getUserInfo({openId:this.$store.state.baseData.openId}).then(resp=>{
            //     console.log(resp)
            //     this.$store.state.baseData=JSON.stringify(resp.data.area)=='null'?{...this.$store.state.baseData}:resp.data.area
            // })/*this.$store.state.baseData.userId*/
        },
        jump(){
            wx.navigateTo({
                url:'./res/main'
            })
        },
        close(){
            this.show=false
        }
    },
    watch:{
        stroageData:function(){
            return this.$store.state.baseData
        }
    },
    components: {
        card,
        // Btn,
        Tip
    },
    onShow(){
        if(!this.userInfo.nickName)
            this.userInfo.nickName=this.$store.state.baseData.userName
        if(!this.userInfo.avatarUrl)
            this.userInfo.avatarUrl=this.$store.state.imgUrl
        if(!this.$store.state.login){
            this.$toast({
                content:'请登入',
                type:'warning'
            })
        }
        this.width=wx.getSystemInfoSync().windowWidth
    },
    created(){
        var that=this
        wx.getStorage({
            key:'userInfo',
            success(res){
                let d=JSON.parse(res.data)
                that.userInfo.avatarUrl=d.avatarUrl
                that.$store.state.baseData.openId=d.openId
                that.$store.state.baseData.userName=d.userName
                that.$store.state.baseData.phoneNumber=d.phoneNumber
                that.$fetch.getTang({openId:d.openId}).then(resp=>{
                    that.$store.state.tangkou=resp.data.reverse()
                })
            }
        })
    }
}
</script>

